// This file represents the MyAccount page component.

import React from 'react';
import { Link } from 'react-router-dom';
import './myaccount.css';
import Navbar from '../../components/navbar';

// Define the MyAccount functional component
const MyAccount = () => {
  return (
    <div>
      <Navbar /> {/* Render the Navbar component */}
      <nav>
        <ul>
          <li>
            <Link to="/personaldata">Personal Data</Link> {/* Link to the Personal Data page */}
          </li>
          <li>
            <Link to="/myorders">My Orders</Link> {/* Link to the My Orders page */}
          </li>
        </ul>
      </nav>
      <div className="content">
        <header className='tit'>
          <h1>Welcome to My Account</h1> {/* Display the heading */}
        </header>
      </div>
    </div>
  );
};

export default MyAccount; // Export the MyAccount component as the default export
